import { Link } from 'react-router-dom';


const Navbar = () => {
  return (  
    <nav className="navbar">
      <h1>Book of Mormon Voices</h1>
      
      <div class="header-item logo-main">
          <img src="/images/LogoLockup-SC.png" alt="Book of Mormon Voices Logo"/>
      </div>
      <div className="links">
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/speaker">Speaker</Link>
        <Link to="/faq">FAQ</Link>
        <Link to="/toolbox">Toolbox</Link>

      </div>
    </nav>

  );
}
 
export default Navbar;
